import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';


const Barranav =()=> {
  return (
    <>
      {['md'].map((expand) => (
        <Navbar key={expand}  expand={expand} className="mb-3 navegacion">
          <Container fluid>
            <Navbar.Brand href="#" className='barra-der'><img src=''></img></Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`navegacion-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>

                </Offcanvas.Title>
              </Offcanvas.Header>

                    <Offcanvas.Body>
                    <Form className="d-flex barra-central">
                  <Form.Control type="search" className="me-2" />
                  <Button variant="outline-success">Buscar</Button>
                </Form>
                        <Nav className="justify-content-end flex-grow-1 pe-3 barra-iz">

                                <Nav.Link href="#action2">Mi carrito</Nav.Link>
                                        <NavDropdown
                                            title="Mi cuenta"
                                            id={`offcanvasNavbarDropdown-expand-${expand}`}
                                        >
                                                    <NavDropdown.Item href="#action4">
                                                    Mis pedidos
                                                    </NavDropdown.Item>
                                            <NavDropdown.Divider />
                                                    <NavDropdown.Item href="#action5">
                                                    Cerrar Sesi√≥n
                                                    </NavDropdown.Item>
                                        </NavDropdown>
                                </Nav>
                    </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </>
  );
}

export default Barranav;
